"Malcolm X" to kolejny teledsk promujący album "Rap Najlepszej Marki". W numerze Szczuba, gościnnie udzielił się Danny. Produkcja: Snobe Beatz. 
W klipie wystąpiły Karolina Mainka, Elwira Dudek, Justyna Korcz oraz jedyny i niepowtarzalny RED! 

Składanka "Rap Najlepszej Marki" składa się z dwóch pełnoprawnych płyt CD. Znajdziecie na nim numery artystów Step Records w najróżniejszych kolaboracjach, wraz z kawałkami raperów zaprzyjaźnionych z wytwórnią.

Album dostępny jest na www.preorder.pl oraz we wsztstkich Empikach. 
